import React from "react";
import { Link } from "react-router-dom";
// import style from "./Card.module.css";
import "./Card.css";

const Card = ({ image, name, temperaments, weight, id }) => {
  return (
    <div className="fondo">
      <div className="container">
        <Link to={"/dog/" + id}>
          <img
            className="card_image"
            src={image}
            alt="img not found"
            width="200px"
            height="250px"
          />
        </Link>

        <h3>{name}</h3>
        <h5 className="temp">
          {temperaments.map((t) => (
            <span>{t.name + <br></br>} </span>
          ))}
        </h5>
        <h5>{weight}</h5>
      </div>
    </div>
  );
};

export default Card;

